import styled from 'styled-components';

export const Cont = styled.div`
  text-align: center;
  padding: 20px;
  background-color: #fff;
  border-radius: 8px;
  width: 300px;

  h3 {
    margin-bottom: 20px;
  }

  button {
    padding: 10px 20px;
    margin: 10px;
    cursor: pointer;
    /* border: none; */
    border-radius: 5px;
    background-color: #ff4d4d;
    color: white;
    font-size: 16px;
  }
`;
